import { useState } from 'react'

const BlogForm = (params) => {

    const [title, setTitle] = useState('')
    const [author, setAuthor] = useState('')
    const [url, setUrl] = useState('')
    
    return(
        <div>
            <form onSubmit={params.addBlog}>
                <div>
                    <label>title: </label><input type='text' value={params.title} onChange={({target}) => params.setTitle(target.value)} />
                </div>
                <div>
                    <label>author: </label><input type='text' value={params.author} onChange={({target}) => params.setAuthor(target.value)} />
                </div>
                <div>
                    <label>url: </label><input type='text' value={params.url} onChange={({target}) => params.setUrl(target.value)} />
                </div>
                <button type="Submit">create</button>
            </form>
        </div>
    )
}
export default BlogForm
